// SPDX-License-Identifier: MIT
pragma solidity ^0.8.3;
uint256 constant MAX_NUMBER_FOR_INDEXES = 255;

enum LicenseType {
    PUBLIC,
    PRIVATE
}
enum LicenseState {
    INACTIVE,
    ACTIVE
}

struct LicenseInfo {
    uint256 registeredOn;
    uint256 expiresOn;
    uint256 activeSince;
    uint256 servicesIdsPool;
    uint256 numberOfMonths;
    LicenseState state;
    LicenseType licenseType;
}

struct LicensesData {
    mapping(uint256 => LicenseInfo) registeredLicenses;
}

library LicenseTools {
    function getBoolean(uint256 _packedBools, uint256 _boolNumber)
        public
        pure
        returns (bool)
    {
        require(
            _boolNumber <= MAX_NUMBER_FOR_INDEXES,
            "boolean index out of range"
        );
        uint256 flag = (_packedBools >> _boolNumber) & uint256(1);
        return (flag == 1 ? true : false);
    }

    function setBoolean(
        uint256 _packedBools,
        uint256 _boolNumber,
        bool _value
    ) public pure returns (uint256) {
        require(
            _boolNumber <= MAX_NUMBER_FOR_INDEXES,
            "boolean index out of range"
        );
        if (_value) return _packedBools | (uint256(1) << _boolNumber);
        else return _packedBools & ~(uint256(1) << _boolNumber);
    }

    function setIndexesBoolean(
        uint256 _packedBools,
        bool _value,
        uint256[] memory _boolNumbers
    ) public pure returns (uint256) {
        if (
            (_boolNumbers.length > 0) &&
            (_boolNumbers.length <= MAX_NUMBER_FOR_INDEXES + 1)
        ) {
            for (uint256 index = 0; index < _boolNumbers.length; index++) {
                _packedBools = setBoolean(
                    _packedBools,
                    _boolNumbers[index],
                    _value
                );
            }
        }
        return _packedBools;
    }

    function insert(
        LicensesData storage self,
        uint256 licenseId,
        uint256 servicesIdsPool,
        LicenseType licenseType,
        uint256 numberOfMonths
    ) public returns (bool) {
        // if (self.registeredLicenses[licenseId].registeredOn != 0) return false; // already there
        self.registeredLicenses[licenseId].registeredOn = block.timestamp;
        self.registeredLicenses[licenseId].state = LicenseState.INACTIVE;
        self.registeredLicenses[licenseId].servicesIdsPool = servicesIdsPool;
        self.registeredLicenses[licenseId].licenseType = licenseType;
        self.registeredLicenses[licenseId].numberOfMonths = numberOfMonths;
        self.registeredLicenses[licenseId].expiresOn = 0;
        self.registeredLicenses[licenseId].activeSince = 0;
        return true;
    }

    function update(
        LicensesData storage self,
        uint256 licenseId,
        uint256 servicesIdsPool,
        uint256 addedMonths
    ) public returns (bool) {
        if (
            !(self.registeredLicenses[licenseId].state ==
                LicenseState.INACTIVE ||
                (self.registeredLicenses[licenseId].expiresOn >
                    block.timestamp &&
                    self.registeredLicenses[licenseId].state ==
                    LicenseState.ACTIVE))
        ) return false;
        self.registeredLicenses[licenseId].servicesIdsPool = servicesIdsPool;
        self.registeredLicenses[licenseId].numberOfMonths += addedMonths;
        if (self.registeredLicenses[licenseId].state == LicenseState.ACTIVE)
            self.registeredLicenses[licenseId].expiresOn +=
                addedMonths *
                30 days;
        return true;
    }

    function activate(LicensesData storage self, uint256 licenseId)
        public
        returns (bool)
    {
        if (self.registeredLicenses[licenseId].state != LicenseState.INACTIVE)
            return false;

        self.registeredLicenses[licenseId].state = LicenseState.ACTIVE;
        self.registeredLicenses[licenseId].expiresOn =
            block.timestamp +
            self.registeredLicenses[licenseId].numberOfMonths *
            30 days;
        self.registeredLicenses[licenseId].activeSince = block.timestamp;
        return true;
    }

    function isLicenseActive(LicensesData storage self, uint256 licenseId)
        public
        view
        returns (bool)
    {
        return (self.registeredLicenses[licenseId].expiresOn > block.timestamp &&
            self.registeredLicenses[licenseId].state == LicenseState.ACTIVE);
    }    

    /**
     * @notice check if user can user a service form the license id
     * @dev Explain to a developer any extra details
     * @param self library
     * @param user user address
     * @param licenseId license id
     * @param serviceId service id to check
     * @return LicenseInfo struct
     */
    function isUserAllowToUseService(
        LicensesData storage self,
        address owner,
        address user,
        uint256 licenseId,
        uint256 serviceId
    ) public view returns (bool) {
        if (
            self.registeredLicenses[licenseId].licenseType ==
            LicenseType.PRIVATE &&
            owner != user
        ) return false;
        return
            getBoolean(
                self.registeredLicenses[licenseId].servicesIdsPool,
                serviceId
            );        
    }    
}

